// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.0;

import "./AwesomePictureNFT.sol";

contract AwesomePictureAuctions {
    struct AuctionInstance {
        string _description;
        address payable _beneficiary;
        uint256 _startTime;
        uint256 _endTime;
        uint256 _startingPrice;
        uint256 _maxBid;
        address _maxBidder;
        mapping(address => uint256) _bidderDeposits;
        bool _exists;
    }

    AwesomePictureNFT _awesomePictureNFT;
    mapping(uint => AuctionInstance) auctions;

    event AuctionCreated(address beneficiary, string description, uint256 startingPrice);
    event MaxBidRegistered(address maxBidder, uint256 maxBid);
    event DepositWithdrawn(address bidder, uint256 bidAmount);
    event AuctionClosed(uint256 maxBid, address MaxBidder, address beneficiary, uint256 time);

    constructor(address awesomePictureNFT) {
        _awesomePictureNFT = AwesomePictureNFT(awesomePictureNFT);
    }

    function addAuction(uint256 nftId, string memory description, uint256 startingPrice, uint256 startTime, uint256 endTime) public returns (uint256) {
        require(_awesomePictureNFT.ownerOf(nftId) == msg.sender, "[ERROR] Only the owner of a NFT can register an auction.");
        require(_awesomePictureNFT.getApproved(nftId) == address(this), "[ERROR] The current contract is not approved to act as spender");

        AuctionInstance storage auction = auctions[nftId];

        require(!auction._exists, "[ERROR] Auction is already active.");

        auction._description = description;
        auction._beneficiary = payable(msg.sender);
        auction._startTime = startTime;
        auction._endTime = endTime;
        auction._startingPrice = startingPrice;
        auction._exists = true;

        emit AuctionCreated(msg.sender, description, startingPrice);

        return nftId;
    }

    function bid(uint nftId) public payable {
        AuctionInstance storage auction = auctions[nftId];

        require(auction._exists, "[ERROR] Auction not registered.");
        require(msg.value > auction._maxBid && msg.value >= auction._startingPrice, "[ERROR] Bid amount is too small.");
        require(block.timestamp <= auction._endTime, "[ERROR] Auction has ended.");

        auction._bidderDeposits[msg.sender] += msg.value;
        auction._maxBid = msg.value;
        auction._maxBidder = msg.sender;

        emit MaxBidRegistered(auction._maxBidder, auction._maxBid);
    }

    function withdraw(uint nftId) public {
        AuctionInstance storage auction = auctions[nftId];

        uint256 bidAmount = auction._bidderDeposits[msg.sender];
        if (msg.sender == auction._maxBidder) {
            bidAmount -= auction._maxBid; 
        }

        require(auction._exists, "[ERROR] Auction not registered.");
        require(block.timestamp >= auction._endTime, "[ERROR] Auction has not ended yet.");
        require(bidAmount > 0, "[ERROR] No deposit found for bidder.");

        auction._bidderDeposits[msg.sender] = 0;

        if (payable(msg.sender).send(bidAmount)) {
            emit DepositWithdrawn(msg.sender, bidAmount);
        } else {
            auction._bidderDeposits[msg.sender] += bidAmount;
        }
    }

    function closeAuction(uint nftId) public {
        AuctionInstance storage auction = auctions[nftId];

        require(auction._exists, "[ERROR] Auction not registered.");
        require(block.timestamp >= auction._endTime, "[ERROR] Auction cannot be closed.");

        auction._beneficiary.transfer(auction._maxBid);
        _awesomePictureNFT.transferFrom(auction._beneficiary, auction._maxBidder, nftId);

        emit AuctionClosed(auction._maxBid, auction._maxBidder, auction._beneficiary, block.timestamp); 

        delete auctions[nftId];
    }

    function retrieveDescription(uint nftId) public view returns (string memory) {
        return auctions[nftId]._description;
    }

    function retrieveStartingPrice(uint nftId) public view returns (uint256) {
        return auctions[nftId]._startingPrice;
    }

    function retrieveStartTime(uint nftId) public view returns (uint256) {
        return auctions[nftId]._startTime;
    }

    function retrieveEndTime(uint nftId) public view returns (uint256) {
        return auctions[nftId]._endTime;
    } 

    function retrieveMaxBid(uint nftId) public view returns (uint256) {
        return auctions[nftId]._maxBid;
    }

    function retrieveMaxBidder(uint nftId) public view returns (address) {
        return auctions[nftId]._maxBidder;
    }
}
